import React from "react";

// Components
import Photo from "../components/Photo";
import SubmitButton from "../components/SubmitButton";

// Styles
import * as S from "./Main.styles";

const Main = () => {
  return (
    <S.MainContainer>
      <Photo />
      <SubmitButton />
    </S.MainContainer>
  );
};

export default Main;
